INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 1, 105, 0, 160, 101, 0.029, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1.5, 1, 0, 1, 1, 122601);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 2, 111, 1, 120, 102, 0.014, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2.5, 0, 0, 3, 2, 122401);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 3, 105, 0, 350, 103, 0.017, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 2.5, 0, 1, 2, 3, 122501);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 4, 105, 1, 130, 104, 0.016, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1.5, 0, 0, 3, 4, 107501);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 5, 105, 0, 160, 105, 0.014, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 2.5, 1, 0, 1, 5, 107601);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (120, 6, 103, 0, 255, 106, 0.029, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 3.5, 0, 1, 2, 6, 107801);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (120, 7, 103, 0, 160, 107, 0.013, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 3.5, 1, 0, 1, 7, 110601);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 8, 103, 0, 350, 108, 0.014, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 2.5, 0, 1, 2, 8, 110401);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 9, 100, 1, 130, 109, 0.012, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1.5, 0, 0, 3, 9, 110501);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 10, 103, 0, 200, 110, 0.014, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 2.5, 1, 0, 1, 10, 115701);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 11, 103, 0, 350, 111, 0.071, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 2.5, 0, 1, 2, 11, 113601);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (120, 12, 103, 1, 130, 112, 0.014, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1.5, 0, 0, 3, 12, 107901);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 13, 105, 0, 200, 113, 0.022, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1.5, 1, 0, 2, 13, 108001);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 14, 108, 0, 160, 114, 0.031, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 2.5, 1, 0, 1, 14, 110301);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 15, 105, 1, 130, 115, 0.036, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.5, 0, 0, 1, 15, 107701);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 16, 95, 0, 350, 116, 0.048, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 3.5, 0, 1, 2, 16, 113101);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 17, 105, 1, 130, 117, 0.043, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1.5, 0, 0, 3, 17, 113301);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 18, 95, 1, 130, 118, 0.018, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1.5, 0, 0, 2, 18, 113201);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 19, 108, 0, 160, 119, 0.021, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 2.5, 1, 0, 2, 19, 117001);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 20, 105, 0, 255, 120, 0.036, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 2.5, 0, 1, 1, 20, 113501);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 21, 105, 0, 350, 121, 0.02, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 2.5, 0, 1, 3, 21, 113401);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 22, 105, 1, 130, 122, 0.018, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 2.5, 0, 0, 1, 22, 110101);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 23, 111, 0, 160, 123, 0.03, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 3.5, 1, 0, 3, 23, 110001);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 24, 103, 1, 130, 124, 0.027, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1.5, 0, 0, 1, 24, 117201);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 25, 108, 0, 160, 125, 0.02, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 3.5, 1, 0, 2, 25, 117301);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 26, 105, 0, 350, 126, 0.04, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 2.5, 0, 1, 3, 26, 117401);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 27, 105, 0, 350, 127, 0.009, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 3.5, 0, 1, 1, 27, 117101);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (120, 28, 105, 0, 255, 128, 0.022, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 3.5, 0, 1, 1, 28, 122901);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (110, 29, 105, 1, 130, 129, 0.028, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 2.5, 0, 0, 3, 29, 122801);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (105, 30, 108, 0, 130, 130, 0.023, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 3.5, 1, 0, 2, 30, 122701);
